// frontend/src/components/ReportSidebar.jsx
import React, { useState, useEffect } from 'react';
import './ReportSidebar.css';

const ReportSidebar = ({ events = [], isOpen, onClose, onGenerateReport }) => {
  const [reportData, setReportData] = useState(null);
  const [isGenerating, setIsGenerating] = useState(false);

  // Ëé∑ÂèñÊúÄËøë5Ê¨°ÂèëÈÄÅÁöÑ‰∫ã‰ª∂
  const getRecentSentEvents = () => {
    const sentEventTypes = ['weather_alert', 'parking_update', 'safety_inspection', 'autonomous_driving'];
    return events
      .filter(event => sentEventTypes.includes(event.type))
      .slice(-5)
      .reverse(); // ÊúÄÊñ∞ÁöÑÂú®Ââç
  };

  // Ëé∑Âèñ‰∏éÂèëÈÄÅ‰∫ã‰ª∂Áõ∏ÂÖ≥ÁöÑÊô∫ËÉΩ‰Ωì‰∫§‰∫í
  const getAgentInteractions = (sentEvent) => {
    if (!sentEvent || !sentEvent.timestamp) return [];

    const sentTime = new Date(sentEvent.timestamp);
    const timeWindow = 5 * 60 * 1000; // 5ÂàÜÈíüÊó∂Èó¥Á™óÂè£

    const responseEventTypes = [
      'workflow_start',
      'main_task_result', 
      'coordination_start',
      'coordination_result',
      'workflow_complete',
      'agent_message',
      'agent_response',
      'analysis_report'
    ];

    return events.filter(event => {
      if (!event || !event.timestamp) return false;

      const eventTime = new Date(event.timestamp);
      const timeDiff = Math.abs(eventTime.getTime() - sentTime.getTime());

      return timeDiff <= timeWindow && 
             responseEventTypes.includes(event.type) && 
             event.type !== sentEvent.type;
    }).sort((a, b) => new Date(a.timestamp) - new Date(b.timestamp));
  };

  // Ëé∑ÂèñÊâÄÊúâÊä•Âëä
  const getAllReports = () => {
    const reports = events.filter(event => event.type === 'analysis_report');
    console.log('üìä Found reports:', reports);
    return reports;
  };

  // ÁîüÊàêÊä•Âëä
  const handleGenerateReport = async () => {
    setIsGenerating(true);
    try {
      await onGenerateReport();
      // Á≠âÂæÖÊä•ÂëäÁîüÊàêÂÆåÊàê
      setTimeout(() => {
        setIsGenerating(false);
      }, 2000);
    } catch (error) {
      console.error('Error generating report:', error);
      setIsGenerating(false);
    }
  };

  // Ëé∑Âèñ‰∫ã‰ª∂ÂõæÊ†á
  const getEventIcon = (type) => {
    const icons = {
      'workflow_start': 'üöÄ',
      'main_task_result': 'üëë',
      'coordination_start': 'ü§ù',
      'coordination_result': 'üéØ',
      'workflow_complete': 'üèÅ',
      'agent_message': 'ü§ñ',
      'agent_response': 'üí¨',
      'analysis_report': 'üìä',
      'weather_alert': 'üåßÔ∏è',
      'parking_update': 'üÖøÔ∏è',
      'safety_inspection': 'üõ°Ô∏è',
      'autonomous_driving': 'üöô',
      'default': 'üìù'
    };
    return icons[type] || icons['default'];
  };

  // Ëé∑Âèñ‰∫ã‰ª∂Á±ªÂûãÊ†áÁ≠æ
  const getEventTypeLabel = (type) => {
    const labels = {
      'workflow_start': 'Â∑•‰ΩúÊµÅÂêØÂä®',
      'main_task_result': '‰∏ªÊô∫ËÉΩ‰ΩìÂçèË∞É',
      'coordination_start': 'Â≠êÊô∫ËÉΩ‰ΩìÂçèË∞É',
      'coordination_result': 'Â≠êÊô∫ËÉΩ‰ΩìÂçèÂêå',
      'workflow_complete': 'Â∑•‰ΩúÊµÅÂÆåÊàê',
      'agent_message': 'Êô∫ËÉΩ‰ΩìÊ∂àÊÅØ',
      'agent_response': 'Êô∫ËÉΩ‰ΩìÂìçÂ∫î',
      'analysis_report': 'ÂàÜÊûêÊä•Âëä',
      'weather_alert': 'Â§©Ê∞îË≠¶Êä•',
      'parking_update': 'ÂÅúËΩ¶Êõ¥Êñ∞',
      'safety_inspection': 'ÂÆâÂÖ®Ê£ÄÊü•',
      'autonomous_driving': 'Ëá™Âä®È©æÈ©∂',
      'default': 'Êú™Áü•‰∫ã‰ª∂'
    };
    return labels[type] || labels['default'];
  };

  // Ê∏≤ÊüìÊô∫ËÉΩ‰Ωì‰∫§‰∫íÊµÅÁ®ã
  const renderAgentInteractionFlow = (interactions) => {
    if (interactions.length === 0) {
      return (
        <div className="no-interactions">
          <div className="no-interactions-icon">‚è≥</div>
          <p>Á≠âÂæÖÊô∫ËÉΩ‰ΩìÂìçÂ∫î...</p>
        </div>
      );
    }

    return (
      <div className="interaction-flow">
        {interactions.map((interaction, index) => (
          <div key={index} className="interaction-step">
            <div className="step-header">
              <span className="step-icon">{getEventIcon(interaction.type)}</span>
              <span className="step-type">{getEventTypeLabel(interaction.type)}</span>
              <span className="step-time">
                {new Date(interaction.timestamp).toLocaleTimeString()}
              </span>
            </div>
            <div className="step-content">
              {interaction.type === 'agent_response' && interaction.payload?.agent ? (
                <div className="agent-response">
                  <strong>{interaction.payload.agent}:</strong> {interaction.payload.result}
                </div>
              ) : interaction.type === 'coordination_result' ? (
                <div className="coordination-result">
                  <strong>ÂçèÂêåÂÆåÊàê:</strong> {interaction.payload?.total_agents || 0}‰∏™Êô∫ËÉΩ‰ΩìÂìçÂ∫î
                </div>
              ) : (
                <div className="step-message">
                  {typeof interaction.payload === 'string' ? interaction.payload : JSON.stringify(interaction.payload)}
                </div>
              )}
            </div>
          </div>
        ))}
      </div>
    );
  };

  // Ê∏≤ÊüìÂèëÈÄÅ‰∫ã‰ª∂ÊëòË¶Å
  const renderSentEventSummary = (event) => {
    if (!event || !event.payload) return 'Êú™Áü•‰∫ã‰ª∂';

    switch (event.type) {
      case 'weather_alert':
        return `Âå∫Âüü: ${event.payload.area || 'Êú™Áü•'} - Á±ªÂûã: ${event.payload.alert_type || 'Êú™Áü•'}`;
      case 'parking_update':
        return `‰ΩçÁΩÆ: ${event.payload.location || 'Êú™Áü•'} - ÂèØÁî®ËΩ¶‰Ωç: ${event.payload.available_spots || 'Êú™Áü•'}`;
      case 'safety_inspection':
        return `‰ΩçÁΩÆ: ${event.payload.location || 'Êú™Áü•'} - Áä∂ÊÄÅ: ${event.payload.safety_status || 'Êú™Áü•'}`;
      case 'autonomous_driving':
        return `Ëµ∑ÁÇπ: ${event.payload.start_location || 'Êú™Áü•'} - ÁªàÁÇπ: ${event.payload.end_location || 'Êú™Áü•'}`;
      default:
        return event.title || event.type;
    }
  };

  const recentEvents = getRecentSentEvents();

  return (
    <div className={`report-sidebar ${isOpen ? 'open' : ''}`}>
      <div className="sidebar-header">
        <h2 className="sidebar-title">üìä Êô∫ËÉΩ‰Ωì‰∫§‰∫íÊä•Âëä</h2>
        <button className="close-btn" onClick={onClose}>‚úï</button>
      </div>

      <div className="sidebar-content">
        {/* Êä•ÂëäÁîüÊàêÊåâÈíÆ */}
        <div className="report-controls">
          <button 
            className="generate-report-btn"
            onClick={handleGenerateReport}
            disabled={isGenerating || recentEvents.length === 0}
          >
            {isGenerating ? 'üîÑ ÁîüÊàê‰∏≠...' : 'üìÑ ÁîüÊàêÁªºÂêàÊä•Âëä'}
          </button>
          <p className="report-hint">
            Âü∫‰∫éÊúÄËøë {recentEvents.length} Ê¨°ÂèëÈÄÅ‰∫ã‰ª∂ÁîüÊàêÊä•Âëä
          </p>
        </div>

        {/* ÊúÄËøëÂèëÈÄÅ‰∫ã‰ª∂ÂàóË°® */}
        <div className="recent-events-section">
          <h3 className="section-title">üì§ ÊúÄËøëÂèëÈÄÅ‰∫ã‰ª∂</h3>
          {recentEvents.length === 0 ? (
            <div className="empty-state">
              <div className="empty-icon">üì≠</div>
              <p>ÊöÇÊó†ÂèëÈÄÅ‰∫ã‰ª∂</p>
              <p className="empty-subtext">ÂèëÈÄÅ‰ªªÂä°‰ª•Êü•Áúã‰∫§‰∫íËÆ∞ÂΩï</p>
            </div>
          ) : (
            <div className="events-list">
              {recentEvents.map((event, index) => {
                const interactions = getAgentInteractions(event);
                return (
                  <div key={index} className="event-item">
                    <div className="event-header">
                      <span className="event-icon">{getEventIcon(event.type)}</span>
                      <div className="event-info">
                        <div className="event-title">{getEventTypeLabel(event.type)}</div>
                        <div className="event-time">
                          {new Date(event.timestamp).toLocaleString()}
                        </div>
                      </div>
                    </div>

                    <div className="event-summary">
                      {renderSentEventSummary(event)}
                    </div>

                    {/* Êô∫ËÉΩ‰Ωì‰∫§‰∫íËÆ∞ÂΩï */}
                    <div className="agent-interactions">
                      <div className="interactions-header">
                        <span className="interactions-title">ü§ñ Êô∫ËÉΩ‰Ωì‰∫§‰∫íËÆ∞ÂΩï</span>
                        <span className="interactions-count">
                          {interactions.length} ‰∏™ÂìçÂ∫î
                        </span>
                      </div>
                      {renderAgentInteractionFlow(interactions)}
                    </div>
                  </div>
                );
              })}
            </div>
          )}
        </div>

        {/* ÁîüÊàêÁöÑÊä•Âëä */}
        <div className="reports-section">
          <h3 className="section-title">üìä ÁîüÊàêÁöÑÊä•Âëä</h3>
          {getAllReports().length === 0 ? (
            <div className="empty-state">
              <div className="empty-icon">üìÑ</div>
              <p>ÊöÇÊó†ÁîüÊàêÁöÑÊä•Âëä</p>
              <p className="empty-subtext">ÁÇπÂáª"ÁîüÊàêÁªºÂêàÊä•Âëä"ÊåâÈíÆÂàõÂª∫Êä•Âëä</p>
            </div>
          ) : (
            <div className="reports-list">
              {getAllReports().map((report, index) => (
                <div key={index} className="report-item">
                  <div className="report-header">
                    <span className="report-icon">üìä</span>
                    <div className="report-info">
                      <div className="report-title">{report.title || 'ÂüéÂ∏ÇÂàÜÊûêÊä•Âëä'}</div>
                      <div className="report-time">
                        {new Date(report.timestamp).toLocaleString()}
                      </div>
                    </div>
                  </div>
                  <div className="report-content">
                    {report.payload && report.payload.report ? (
                      <div className="report-text">
                        {report.payload.report.split('\n').map((line, lineIndex) => (
                          <p key={lineIndex} className="report-paragraph">{line}</p>
                        ))}
                      </div>
                    ) : (
                      <p className="report-text">Êä•ÂëäÂÜÖÂÆπÂä†ËΩΩ‰∏≠...</p>
                    )}
                  </div>
                </div>
              ))}
            </div>
          )}
        </div>

        {/* ÁªüËÆ°‰ø°ÊÅØ */}
        <div className="stats-section">
          <h3 className="section-title">üìà ÁªüËÆ°‰ø°ÊÅØ</h3>
          <div className="stats-grid">
            <div className="stat-item">
              <div className="stat-value">{recentEvents.length}</div>
              <div className="stat-label">ÂèëÈÄÅ‰∫ã‰ª∂</div>
            </div>
            <div className="stat-item">
              <div className="stat-value">
                {recentEvents.reduce((sum, event) => sum + getAgentInteractions(event).length, 0)}
              </div>
              <div className="stat-label">Êô∫ËÉΩ‰ΩìÂìçÂ∫î</div>
            </div>
            <div className="stat-item">
              <div className="stat-value">{getAllReports().length}</div>
              <div className="stat-label">ÁîüÊàêÊä•Âëä</div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ReportSidebar;
